import { Container, styled} from "@mui/material";
import CardSimplePost from "../CardSimplePost/CardSimplePost";

const ContainerFeed = styled(Container)(({ theme }) => ({
    paddingTop: theme.spacing(10),
    // backgroundColor: 'yellow',
    height: '100%',
    overflow: 'auto'
}));

const Feed = () => {
    return (
        <ContainerFeed>
            <CardSimplePost 
            post="" />
        </ContainerFeed>
    );
};

export default Feed;
